import NavBar from "./Navbar";
import SideBar from "./Sidebar";
function StudentView(){
    const [data, setData] = useState([])
	const [refresh, setRefresh] = useState(0)

	useEffect(() => {
		fetch('http://localhost:4002/view').then((res) =>
			res.json()
		).then((result) => 
		setData(result)
		// console.log(result)
		)		
	}, [refresh])
    
    return(
        <>
       <div class="content">
        <NavBar/>
        <SideBar/>
        
       </div>
        </>
    )
}
export default StudentView;
